;; **
;;; To continue, let us load the data. Remind that the data we use is the [Fisher Iris data](https://archive.ics.uci.edu/ml/datasets/Iris);
;;; each row of data consists of four measurements made regarding an Iris flower.
;;; 
;;; We begin by reading in the Iris dataset from its CSV file, placing the measuments into a matrix @@X@@ and the labels into a vector @@y@@.
;; **

;; @@
(def iris-data
  (loop [X []
         y []
         data (with-open [file (io/reader "data/iris.csv")]
                (doall (csv/read-csv file)))]
    (def row (first data))
    (if (nil? row)
      [(m/matrix X) y]
      (recur (conj X (map #(Float/parseFloat %) (take 4 row)))
             (conj y (keyword (peek row)))
             (rest data)))))

(def X (get iris-data 0))
(def y (get iris-data 1))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris-collapsed/y</span>","value":"#'gmm-iris-collapsed/y"}
;; <=

;; **
;;; Let us plot the Iris data to get an idea what it looks like. The data is 4-dimensional (i.e., 4 measurements per flower), but we can use <a href="https://en.wikipedia.org/wiki/Principal_component_analysis">Principal component analysis</a> (PCA) to project it down into 2 dimensions for visualisation purposes.
;; **

;; @@
(def label-indices (apply zipmap ((fn [v] [(into () v)
                                           (range (count v))]) (into #{} y))))
(def colours ["#34C6F2" "#64F54A" "#F13F6F" "#E4AEFB" "#253B3E" 
              "#8B5904" "#BBC324" "#EAC092" "#360A07" "#0888A4"])
(defn get-colour [label]
  (get colours (label label-indices)))

(defn black [label]  "#000000")

(defn plot-2d [data labels colour-fn & [jitter & options]]
  "plotting function that plots the first two dimensions of the provided data"
  (reduce plot/compose
          (cons
            (plot/list-plot (map #(take 2 %) data) :colour "#ffffff")
            (for [[label indices] (group-by #(get labels %)
                                            (range (count labels)))]
              (let [points (m/select data indices [0 1])
                    colour (colour-fn label)
                    points (if jitter
                             (op/+ points
                                   (op/* jitter
                                         (sample* (mvn [0. 0.]
                                                      (m/identity-matrix 2)))))
                             (op/+ points 0.0))]
                (plot/list-plot points :colour colour :symbol-size 20))))))

(defn plot-pca [data labels colour-fn]
  "plotting function that takes high-dimensional data
  and projects into 2d for visualzation"
  (let [projection (m/transpose
                     (m/select (:V*
                                 (linalg/svd X {:return [:V*]})) [1 0] :all))
        data (m/mmul X projection)]
    (plot-2d data labels colour-fn)))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris-collapsed/plot-pca</span>","value":"#'gmm-iris-collapsed/plot-pca"}
;; <=

;; **
;;; Compare the two resulting plots below. The first plots the first two dimensions of the data; the second plots the data projected onto the first two principal components.
;;; 
;;; It is clear that one of the Iris species is easily separable from the other two, while two of the varieties are less distinguishable.
;; **

;; @@
(plot-2d X y get-colour 0.01)
(plot-pca X y get-colour)
