;; **
;;; ## Unsupervised learning
;;; 
;;; In the plots above, we see the Iris data coloured using the *true labels* given by @@y@@.
;;; One typical machine learning task would involve learning a classifier, which would allow us to predict the Iris variety of a particular flower (i.e., @@y_n@@) given only its measurements @@\mathbf{x}_n@@. The classifier is trained on a training dataset with known @@\\{ \mathbf{x}_n \\}@@ and @@\\{y_n\\}@@. Then, the classifier is applied to a test dataset, which contains only @@\\{y'_k\\}@@, with the aim to predict @@\\{\hat{\mathbf{x}}'_k\\}@@.
;;; 
;;; As alternative, we could consider an *unsupervised learning* task, where we suppose that the true Iris species labels were unknown. 
;;; 
;;; 
;; **

;; @@
(plot-pca X y black)
;; @@

;; **
;;; In such a situation, given just the measurement data @@\\{ \mathbf{x}_n \\}@@, we may wish to ask questions such as 
;;; 
;;; * "Are two different measurements @@\mathbf{x}_i@@ and @@\mathbf{x}_j@@ of the same or different Iris variety?"
;;; * "In the 150 total different measurements, how many different species of flowers might there be?"
;;; 
;;; Notice that these are qualitatively different tasks than _label prediction_ that we may attempt using (say) logistic regression, and labeled training data.
;; **

;; **
;;; Now, we draw and plot some samples from the model defined above using Particle Gibbs (PGibbs) inference.
;; **

;; @@
(defn draw-sample-sequencies [model n-sample-sequencies
                              n-particles & [hyper-priors]]
  "simple helper to sample sequencies from the posterior using
  PGibbs and thin them; throw out 50% as burn-in"
  (let
    [samples
     (take n-sample-sequencies
           (take-nth 2 (take-nth n-particles
                                 (doquery :pgibbs model
                                          [X (assoc hyper-priors :K 5)]
                                          :number-of-particles n-particles))))
     predicts (map :z (map get-predicts samples))]
    predicts))

;; draw samples
(def samples (draw-sample-sequencies gmm-collapsed 10 1000))

;; plot them, each; see how the samples evolve?
(map (fn [sample]
       (let [y-hat sample]
         (plot-pca X y-hat #(get colours %))))
     samples)

