;; **
;;; # Comparing the uncollapsed and collapsed ways of modelling the Gaussian mixture model
;;; 
;;; As described in the introduction, the model defined in this worksheet with collapsed conjugate pairs is the same statistical model as the uncollapsed one, defined in the previous worksheet. Below we repeat the Gaussian mixture model without XRPs, as defined in the original worksheet.
;; **

;; @@
(with-primitive-procedures [row-mean invert shape
                            identity-matrix get-row calc-cov-matrix mmul]
  (defquery gmm-uncollapsed [data & [hyper-priors]]
    "Gaussian mixture model without collapsed conjugate pairs"
    (let [[N D] (shape data)

          ;; there are many hyper-priors; we provide defaults
          K 		(:K 		hyper-priors 10)
          alpha 	(:alpha		hyper-priors 1.0)
          mu-0		(:mu-0		hyper-priors (row-mean data))
          lambda-0 	(:lambda-0	hyper-priors (identity-matrix D))
          nu		(:nu		hyper-priors (inc D))
          kappa		(:kappa		hyper-priors 1.0)

          ;; sample the latent variables.
          ;;
          ;; mu and sigma are per-cluster here we sample them ideally,
          ;; while in the model with XRPs above we "sample" them lazily
          pi (sample (dirichlet (repeat K alpha)))
          lambda (into [] (map sample (repeat K (wishart nu lambda-0))))
          mu (into [] (map (fn [k]
                             (sample (mvn mu-0
                                          (invert kappa (get lambda k)))))
                           (range K)))
          sigma (into [] (map invert lambda))]
      
      ;; for each data point, sample z[n] and `observe`
      (loop [n 0
             z []]
        (if (= n N)
          (predict :z z)
          (let [row (get-row data n)
                k (sample (discrete pi))]
            (observe (mvn (get mu k) (get sigma k)) row)
            (recur (inc n) (conj z k))))))))
