;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris-collapsed/gmm-uncollapsed</span>","value":"#'gmm-iris-collapsed/gmm-uncollapsed"}
;; <=

;; **
;;; Since we collapse the conjugate pairs, we expect that we need to spend less computational resources for the inference in order to receive predictions of the same or better quality. Let us verify this hypothesis by running inference in both versions of the same model.
;;; 
;;; We expect that running the collapsed version will take more time (due to unoptimised matrix operations, for now), but it will need less number of particles to receive the same or better inference results.
;;; 
;;; To measure the inference results, we measure the <a href="https://en.wikipedia.org/wiki/Mutual_information#Normalized_variants">normalised mutual information</a> between the predicted sequence @@\\{\mathbf{x}_n\\}@@ and the true sequence @@\\{\mathbf{x}'_n\\}@@. Below we introduce the procedure `calc-nmi` that calculates the normalised mutual information between two sequences, as well as necessary helper procedures.
;;; 
;;; (Please, keep in mind that it is not always right to check, on whether inference results are good or not, just by comparing predictions with true labels. It is okay only if we believe that the model and its hyper-priors are the good fit for the data.)
;; **

;; @@
(defn log2 [n]
  "calculates the logarithm with base 2"
  (/ (Math/log n) (Math/log 2)))

(defn sum [seq]
  "calculates the sum of elements in the sequence"
  (reduce + seq))

;; Based on
;; http://nlp.stanford.edu/IR-book/html/htmledition/evaluation-of-clustering-1.html
(defn calc-entropy
  [data]
  "calculates entropy of the data sequence"
  (let
    [freq (frequencies data)
     N (count data)]
    (-
     (sum (map (fn [count] (* (/ count N) (log2 (/ count N)))) (vals freq))))))

(defn calc-intersection-factor
  [intersection-count k-count j-count N]
  "calculates one sum element for the mutual information"
  (if (nil? intersection-count)
    0
    (*
     (/ intersection-count N)
     (log2 (/ (* N intersection-count) (* k-count j-count))))))

(defn calc-mi
  [seq-test seq-true]
  "calculates mutual information of two data sequences"
  (let
    [seq-test-freq (frequencies seq-test)
     seq-true-freq (frequencies seq-true)
     seq-test-true (map (fn [k j] (list k j)) seq-test seq-true)
     seq-test-true-freq (frequencies seq-test-true)
     N (count seq-test)]
    (sum
     (map
      (fn [k]
        (sum (map (fn [j]
                    (calc-intersection-factor
                     (get seq-test-true-freq (list k j))
                     (get seq-test-freq k)
                     (get seq-true-freq j)
                     N

                     )) (keys seq-true-freq))))
      (keys seq-test-freq)))))

(defn calc-nmi
  [seq-test seq-true]
  "calculates the normalised mutual information"
  (/ (calc-mi seq-test seq-true)
     (/ (+ (calc-entropy seq-test) (calc-entropy seq-true)) 2)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris-collapsed/calc-nmi</span>","value":"#'gmm-iris-collapsed/calc-nmi"}
;; <=

;; **
;;; We would like to measure not only how good our predictions are, but also how much time does inference take for both versions of the model. To do this, we create Clojure macro `get-evaluation-result-and-time`, which evaluates the expression, and then returns the evaluated sequence and time that it took to evaluate that sequence.
;; **

;; @@
(defmacro get-evaluation-result-and-time [expression]
  "Returns an amount of time and result of an evaluation of an expression"
  `(let
    [start-time# (System/currentTimeMillis)
     eval-result# (doall ~expression)]
    (list (- (System/currentTimeMillis) start-time#) eval-result#)))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris-collapsed/get-evaluation-result-and-time</span>","value":"#'gmm-iris-collapsed/get-evaluation-result-and-time"}
;; <=

;; **
;;; We introduce procedure `calc-average-time-and-nmi` that runs inference for the specified version of the model (i.e. uncollapsed or collapsed). 
;; **

;; @@
(defn average [seq]
  "calculates the average for the sequence"
  (/ (sum seq) (count seq)))

(defn calc-nmi-for-Iris
  [candidate-sequence]
  (calc-nmi candidate-sequence y))

(defn calc-average-time-and-nmi
  [model number-of-sample-sequencies number-of-particles & [hyper-priors]]
  (let
    [time-and-nmis
     (get-evaluation-result-and-time
       (draw-sample-sequencies model
                               number-of-sample-sequencies
                               number-of-particles hyper-priors))]
    (list (first time-and-nmis)
          (average (map calc-nmi-for-Iris (second time-and-nmis))))))

