;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris-collapsed/plot-compose</span>","value":"#'gmm-iris-collapsed/plot-compose"}
;; <=

;; **
;;; Finally, we run inference with both models 100 times, to have an idea on the distribution of the quality of their predictions (using NMI). We run the collapsed version with 100 particles, and we run the uncollapsed version with 200 particles.
;; **

;; @@
;; http://stackoverflow.com/questions/30775032/transpose-a-matrix-in-racket-list-of-lists
(defn transpose [xss]
  (apply map list xss))

(def collapsed-results 
  (transpose
    (repeatedly 100
                (fn [] (calc-average-time-and-nmi
                         gmm-collapsed 5 100)))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris-collapsed/collapsed-results</span>","value":"#'gmm-iris-collapsed/collapsed-results"}
;; <=

;; @@
(def uncollapsed-results
(transpose
(repeatedly 100
(fn [] (calc-average-time-and-nmi
gmm-uncollapsed 5 200)))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris-collapsed/uncollapsed-results</span>","value":"#'gmm-iris-collapsed/uncollapsed-results"}
;; <=

;; @@
(plot-compose
  (list (second collapsed-results) (second uncollapsed-results))
  (list "green" "red"))
