;; **
;;; As we can see from the histograms above, the collapsed version (in green) produces predictions of better quality in comparison to the uncollapsed version (in red), even though we used twice less particles. X-axis is the value of NMI, y-axis is frequency.
;;; 
;;; We also might be interested in the distribution of wall time, which is required to run inference in both versions. The histograms below show that better predictions were obtained not at the cost of spending more computational resources (x-axis is wall time, y-axis is frequency; the collapsed model is in green, and the uncollapsed model is in red).
;; **

;; @@
(plot-compose
  (list (first collapsed-results) (first uncollapsed-results))
  (list "green" "red"))

